import React from "react";

function Sellings() {
  return (
    <div className="sellings">
      <div className="container">
        <div className="products-settings">
          <h3>New Products</h3>
          <ul>
            <li className="active">All</li>
            <li>Smartphones</li>
            <li>Watches</li>
            <li>Headphones</li>
            <li>Laptops</li>
            <li>Cameras</li>
          </ul>
        </div>
        <div className="sellings-content"></div>
      </div>
    </div>
  );
}

export default Sellings;
